import React from "react";
import "./StartProject.css";
import rectangel from "../../../logos/Rectangle 3.png";

const StartProject = () => {
  return (
    <div className='section'>
      <div className='section_wrapper'>
        <div className='project_content'>
          <h2 className='section_title'>Start your project with Brandit</h2>
          <p className='info_text'>Send us a message today to get started.</p>
          <form className='project_form' action=''>
            <label htmlFor=''>Name</label>
            <input className='project_input' type='text' id='text' />
            <label htmlFor=''>Email</label>
            <input className='project_input' type='text' id='text' />
            <label htmlFor=''>Message</label>
            <input className='project_input' type='text' id='text' />
          </form>
        </div>
        <img className='rectangel_img' src={rectangel} alt='' />
      </div>
      <div className='project_button'>
        <button className='info_button'>Send Message</button>
      </div>
    </div>
  );
};

export default StartProject;
